import t from '../images/t.png';

const NavBarItem = ({title,classProps}) => {
    return (
        <li className={`mx-4 cursor-pointer ${classProps} white-text`}>
            {title}
        </li>
    )
}

const Navbar = () => {
    return (
        <nav className="w-full flex justify-between p-4  bg-gradient-to-r from-purple-500 to-blue-900">
            <div className="md:flex-[0.5] justify-center">
                <img src={t}  alt="" className="w-32 cursor-pointer"/>
            </div>
            <ul className='text-white md:flex hidden list-none flex-row justify-between items-center flex-initial'>
            {["Market", "Exchange", "Tutorials", "Wallets"].map((item, index) => (
                <NavBarItem key={item + index} title={item} />
            ))}
            <li className="bg-[#2952e3] py-2 px-7 mx-4 rounded-full cursor-pointer hover:bg-[#2546bd]">
            Login
            </li>
            </ul>
        </nav>
    );
}


export default Navbar;
